import React, { useEffect, useState } from "react";
import "../../styles/flowTwo/ZipCodePage.css";

const ZipCodePage2 = ({ nextStep, updateFormData }) => {
  const [zipCode, setZipCode] = useState("");
  const [error, setError] = useState("");
  const [location, setLocation] = useState("your area"); // Default location

  useEffect(() => {
    // Fetch user's location when the component loads
    const fetchLocation = async () => {
      try {
        const response = await fetch(
          "https://ipinfo.io?token=YOUR_ACCESS_TOKEN"
        );
        const data = await response.json();
        setLocation(data.region || "your area"); // Update location dynamically
      } catch (error) {
        console.error("Error fetching location:", error);
      }
    };

    fetchLocation();
  }, []);

  const handleInputChange = (e) => {
    setZipCode(e.target.value);
    setError(""); // Clear error on input change
  };

  const handleSubmit = () => {
    if (/^\d{5}$/.test(zipCode)) {
      updateFormData("zipCode", zipCode); // Save data
      nextStep(); // Go to the next step
    } else {
      setError("Please enter a valid US ZIP Code");
    }
  };

  return (
    <div className="zip-code-container">
      <h1>Find the lowest car insurance rates in {location}!</h1>
      <div className="zip-code-box">
        <label htmlFor="zipCode">What is your ZIP Code?</label>
        <input
          type="text"
          id="zipCode"
          placeholder="ZIP Code"
          value={zipCode}
          onChange={handleInputChange}
        />
        <button onClick={handleSubmit}>Start Now</button>
        {error && <p className="error-message">{error}</p>}
      </div>

      {/* Partner Section */}
      <section className="partner js-home">
        <div className="container">
          <div className="row">
            <div className="col-12 text-center">
              <h3 className="partner__title">OUR PARTNERS</h3>

              <div className="partner__wrapper">
                <div className="partnerLogo">
                  {/* Partner Logo 1 */}
                  <div className="partnerLogo__holder">
                    <img
                      src="https://www.allstate.com/dist/content-client-react-app/static/media/logo-large.dd47a938943f3af25de5f6885d2c39d8.svg"
                      alt="Allstate"
                      className="partnerLogo__image"
                    />
                  </div>

                  {/* Partner Logo 2 */}
                  <div className="partnerLogo__holder">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      viewBox="0 0 139 34"
                      fill="none"
                      className="partnerLogo__image"
                    >
                      {/* SVG content for "The General" */}
                      <path d="..." fill="black" />
                    </svg>
                  </div>

                  {/* Partner Logo 3 */}
                  <div className="partnerLogo__holder">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      viewBox="0 0 158 40"
                      fill="none"
                      className="partnerLogo__image"
                    >
                      {/* SVG content for "Progressive" */}
                      <path d="..." fill="#2D95E5" />
                    </svg>
                  </div>
                </div>

                <div className="partner__text d-none d-md-flex">
                  +25
                  <br />
                  more
                </div>
              </div>

              <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 19 34"
                className="partner__downArrow"
                height="33.657"
                width="19.657"
              >
                <path d="M17,34a2,2,0,0,1-1.41-.59l-15-15a2,2,0,0,1,0-2.82l15-15a2,2,0,0,1,2.82,0,2,2,0,0,1,0,2.82L4.83,17,18.41,30.59A2,2,0,0,1,17,34Z"></path>
              </svg>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default ZipCodePage2;
